import React,{useState} from 'react';
import {CheckBox ,ImageBackground,TouchableOpacity,StyleSheet, Text, View, TextInput, Alert, Button, RecyclerViewBackedScrollView } from 'react-native';


export default class App extends React.Component {
  constructor() {
    super();
    this.state = {
     color:'red',
     count:1,
    };
  }
  changeprops=()=>{
    if (this.state.count% 2 === 0){
    this.setState({color:'green'})}
    else{
    this.setState({color:'yellow'})}
    this.setState({count:this.count++})
  }
  
  render() {
    return (
      <View  style={styles.container}>
        <Text>{this.state.color}</Text>
        <Button title="change props"
        onPress={this.changeprops}></Button>
      </View>
    );
  }
}

const styles=StyleSheet.create({
  container:{
    justifyContent:'center',
    alignItems:'center',
    flex:1,
  },
  button:{
    width:100,
    height:30,
    backgroundColor:"red",
  }
});
